import React from 'react';

function Profile() {
  const user = {
    name: "AnagaShri",
    email: "anagashri@example.com"
  };

  return (
    <div className="text-center mt-5">
      <img
        src="https://www.google.com/imgres?q=profile%20icon&imgurl=https%3A%2F%2Fstatic.vecteezy.com%2Fsystem%2Fresources%2Fpreviews%2F026%2F630%2F551%2Fnon_2x%2Fprofile-icon-symbol-design-illustration-vector.jpg&imgrefurl=https%3A%2F%2Fwww.vecteezy.com%2Fvector-art%2F26630551-profile-icon-vector-symbol-design-illustration&docid=fz9gQdUizYgG1M&tbnid=-6H8QhIiqMO8AM&vet=12ahUKEwiq3-uivdiPAxXKa2wGHWyELCYQM3oECCEQAA..i&w=980&h=980&hcb=2&ved=2ahUKEwiq3-uivdiPAxXKa2wGHWyELCYQM3oECCEQAA"
        alt="User"
        className="rounded-circle mb-3"
      />
      <h3>{user.name}</h3>
      <p>{user.email}</p>
    </div>
  );
}

export default Profile;
